import React from "react";
import { Col } from "antd";
import { WrapperHeader, WrapperTextHeader, WrapperHeaderAccout } from "./style";
import Search from "antd/es/transfer/search";
import { UserOutlined, CaretDownOutlined } from "@ant-design/icons";

const HeaderComponent = () => {
  return (
    <div>
      <WrapperHeader>
        <Col span={6}>
          <WrapperTextHeader>shipper</WrapperTextHeader>
        </Col>
        <Col span={12}>
          <Search
            placeholder="input search text"
            //onSearch={onSearch}
            enterButton
          />
        </Col>
        <Col span={6}>
          <WrapperHeaderAccout>
            <div>
              <UserOutlined style={{ fonrSize: "30px" }} />
            </div>
            <div>
              <span>Đắng nhập/Đăng kí</span>
              <div>
                <span>Tài khoản </span>
                <CaretDownOutlined />
              </div>
            </div>
          </WrapperHeaderAccout>
        </Col>
      </WrapperHeader>
    </div>
  );
};

export default HeaderComponent;
